import React from 'react';
import styles from "../Nav/Nav.module.css"

export default function Login() {
  return (
    <div>
             <nav className={`${styles.nav} flex align-items-center`}>
        <h1 className={styles["nav-title"]}>Sign Up</h1>
        </nav>
    </div>
  )
}
